/**
 * Simple test script for grid overlay functionality
 *
 * This script creates a blank canvas image, adds a grid overlay to it,
 * and saves the result to a file.
 */

import { addGrid, GridOptions } from './src/utils/image_utils.js'; // Re-added .js extension
import * as fs from 'fs';
import * as path from 'path';
import { createCanvas } from '@napi-rs/canvas';

async function testGridOverlay() {
  console.log('Starting grid overlay test...');

  try {
    // Create a test output directory
    const outputDir = path.join(process.cwd(), 'test-output');
    if (!fs.existsSync(outputDir)) {
      fs.mkdirSync(outputDir, { recursive: true });
    }

    // Create a simple test image using canvas
    const width = 800;
    const height = 600;
    const canvas = createCanvas(width, height);
    const ctx = canvas.getContext('2d');

    // Fill with a dark gray background
    ctx.fillStyle = '#333333';
    ctx.fillRect(0, 0, width, height);

    // Add some shapes to test coordinate positioning
    ctx.fillStyle = 'red';
    ctx.fillRect(100, 100, 50, 50); // Square at 100,100

    ctx.fillStyle = 'blue';
    ctx.beginPath();
    ctx.arc(300, 300, 40, 0, Math.PI * 2); // Circle at 300,300
    ctx.fill();

    ctx.fillStyle = 'green';
    ctx.beginPath();
    ctx.arc(500, 200, 30, 0, Math.PI * 2); // Circle at 500,200
    ctx.fill();

    // Convert canvas to base64 image
    const imageBuffer = canvas.toBuffer('image/png');
    const base64Image = `data:image/png;base64,`;

    // Save the original test image
    const originalPath = path.join(outputDir, 'test-image-original.png');
    fs.writeFileSync(originalPath, imageBuffer);
    console.log(`Original test image saved to: ${originalPath}`);

    // Define grid options for different variants
    const gridOptions: GridOptions[] = [
      {
        spacing: 50,
        color: 'rgba(255,255,255,0.3)',
        lineWidth: 1
      },
      {
        spacing: 50,
        majorSpacing: 200,
        color: 'rgba(255,255,255,0.4)',
        lineWidth: 1,
        majorLineWidth: 2
      },
      {
        spacing: 25,
        color: 'rgba(255,255,255,0.2)',
        lineWidth: 1
      },
      {

      }
    ];

    // Add grids with different options
    for (let i = 0; i < gridOptions.length; i++) {
      // Add grid to the image
      const imageWithGrid = await addGrid(
        base64Image,
        1,      // Device pixel ratio (1 for our test)
        gridOptions[i]
      );

      // Save the image with grid overlay
      const gridImagePath = path.join(outputDir, `test-image-grid-${i+1}.png`);

      // Extract the base64 data and convert to buffer
      const gridImageData = imageWithGrid.replace(/^data:image\/\w+;base64,/, '');
      const gridImageBuffer = Buffer.from(gridImageData, 'base64');

      // Write the file
      fs.writeFileSync(gridImagePath, gridImageBuffer);
      console.log(`Grid variant ${i+1} saved to: ${gridImagePath}`);
    }

    return { success: true, outputDir };
  } catch (error) {
    console.error('Error in grid overlay test:', error);
    return { success: false, error };
  }
}

// Run the test
testGridOverlay().then(result => {
  if (result.success) {
    console.log(`Grid overlay test completed successfully!`);
    console.log(`Output saved at: ${result.outputDir}`);
  } else {
    console.error('Grid overlay test failed:', result.error);
    process.exit(1);
  }
});
